import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const DisplayScreen = ({ route }) => {
  const inputData = route.params?.inputData;

  return (
    <View style={styles.container}>
      <Text style={styles.text}>Registered Data:</Text>
      <Text style={styles.data}>{inputData}</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  text: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  data: {
    fontSize: 16,
    color: '#333',
  },
});

export default DisplayScreen;
